sequentie = ""
print(sequentie)
print("Aantal C in de sequentie =", sequentie.count("C"))
print("Aantal G in de sequentie =", sequentie.count("G"))
print("Aantal A in de sequentie =", sequentie.count("A"))
print("Aantal T in de sequentie =", sequentie.count("T"))
totaal = sequentie.count("C") + sequentie.count("G") + sequentie.count("A") + sequentie.count("T")
print("Totaal aantal nucleotide =", totaal)
CG = sequentie.count("c") + sequentie.count("G")
CGpercentage = CG / totaal * 100
print("Het CG% in de sequentie =", CGpercentage, "%")
print("Het GC percentage van het gehele organisme( de Gallus gallus) = 41.9137 %")
